import React from 'react';
import { Container, Row, Col, Button } from 'react-bootstrap';
import { Link, useNavigate } from 'react-router-dom';
import '../styles/Home.css';

const Home = () => {
  const navigate = useNavigate();
  const isAuthenticated = localStorage.getItem('isAuthenticated') === 'true';

  const handleReportClick = () => {
    if (isAuthenticated) {
      navigate('/report');
    } else {
      navigate('/login');
    }

    if (isAuthenticated) {
      navigate('/report');
    } else {
      navigate('/login');
    }
  };

  return (
    <div className="home-page">
      {/* Hero Section */}
      <section className="hero-section">
        <Container>
          <Row className="align-items-center">
            <Col lg={6} className="hero-content">
              <h1>Report Harassment Safely and Confidentially</h1>
              <p className="lead">
                HTUharassment provides a secure platform for reporting harassment incidents.
                Your voice matters, and we're here to help you speak up against harassment.
              </p>
              <div className="hero-buttons">
                <Button
                  onClick={handleReportClick}
                  variant="primary"
                  size="lg"
                  className="me-3"
                >
                  Report Now
                </Button>
              </div>
            </Col>
            <Col lg={6} className="hero-image">
              <img
                src="/images/speak-up.svg"
                alt="Stand against harassment"
                className="img-fluid"
              />
            </Col>
          </Row>
        </Container>
      </section>

      {/* Features Section */}
      <section className="features-section">
        <Container>
          <h2 className="text-center mb-5">Why Choose HTUharassment?</h2>
          <Row>
            <Col md={4}>
              <div className="feature-card">
                <i className="fas fa-shield-alt feature-icon"></i>
                <h3>Confidential Reporting</h3>
                <p>
                  Your privacy and security are our top priorities. All reports are handled with strict confidentiality.
                </p>
              </div>
            </Col>
            <Col md={4}>
              <div className="feature-card">
                <i className="fas fa-hand-holding-heart feature-icon"></i>
                <h3>Support & Resources</h3>
                <p>
                  Access support services and resources to help you through the process.
                </p>
              </div>
            </Col>
            <Col md={4}>
              <div className="feature-card">
                <i className="fas fa-justice feature-icon"></i>
                <h3>Quick Response</h3>
                <p>
                  Our dedicated team ensures prompt attention to every report submitted.
                </p>
              </div>
            </Col>
          </Row>
        </Container>
      </section>

      {/* Call to Action Section */}
      <section className="cta-section">
        <Container className="text-center">
          <h2>Stand Up Against Harassment</h2>
          <p className="lead mb-4">
            Don't stay silent. Report incidents and help create a safer environment for everyone.
          </p>
          <Button
            onClick={handleReportClick}
            variant="primary"
            size="lg"
          >
            Report an Incident
          </Button>
        </Container>
      </section>
    </div>
  );
};

export default Home;
